productDetail.calculationRuleText:
1 ။ နောက်ဆုံး 0 ယ်ယူမှုမတိုင်မီ 0 က်ဘ်ဆိုက်ရှိထုတ်ကုန်အားလုံး၏နောက်ဆုံး 0 ယ်ယူမှုအချိန်မှတ်တမ်းများကိုယူပါ။

2 ။ တစ်ခုချင်းစီကို timestamp ကိုနောက်ဆက်တွဲအလားတူစီစဉ်ထားပြီး၎င်း၏တန်ဖိုးကိုယူသည်;

3 ။ ဤတန်ဖိုး 100 ၏ပေါင်းလဒ်သည်ကုန်ပစ္စည်းတွင်ပါဝင်သူစုစုပေါင်းပါ 0 င်သူစုစုပေါင်းနှင့်ကျန်ရှိနေသေးသောအပေါင်း 10000001 သည် "Lucky Code" ဖြစ်သည်။
